const Loader = ({ handleClose }) => {
    const [presentage, setPresentage] = useState(0);

    useEffect(() => {
        const interval = setInterval(() => {
            if (presentage < 100) {
                setPresentage((prevProgress) => prevProgress + 2);
            } else {
                handleClose();
            }
        }, 50);

        return () => clearInterval(interval);
    }, [presentage]);

    return (
        <div
            className="relative z-50"
            aria-labelledby="modal-title"
            role="dialog"
            aria-modal="true"
        >
            <div className="fixed inset-0 bg-black bg-opacity-90 transition-opacity flex justify-center">
                <div className="mt-28 ">
                    <SvgComponent fill={"#143b46"} />

                    <div className="bg-slate-300 w-full rounded-sm">
                        <div
                            className="bg-primary py-2"
                            style={{ width: `${presentage}%` }}
                        ></div>
                    </div>
                    <p className="text-center text-slate-500 mt-3">
                        {"Loading " + presentage + "%"}
                    </p>
                </div>
            </div>
        </div>
    );
};

export default Loader;
